import React from "react";
import { Route, Switch } from "react-router-dom"
import { BrowserRouter } from "react-router-dom"

import News from "../page/news"
import Dummy1 from "../component/dummy1"
import Dummy2 from "../component/dummy2"
// import NewsCategory from "../page/newsCategory"

const MainRoute = () => {
    return (
        <BrowserRouter>
            <Switch>
                <Route path="/news" component = {News}/>
                <Route  path="/ekonomi" component = {Dummy1}/>
                <Route  path="/politik" component = {Dummy2}/>
                {/* <Route exact path="/news-category/:category" component = {NewsCategory}/> */}
            </Switch>
        </BrowserRouter>
    );
};

export default MainRoute;
